import React, { useState, ChangeEvent, FormEvent } from 'react';

interface ClientData {
  clientName: string;
  alienNumber: string;
  dob: string;
  categoryOfORREligibility: string;
  dateOfEligibility: string;
  gender: string;
  nationality: string;
  ethnicity: string;
  languages: string;
  phoneNumber: string;
  address: string;
  emailAddress: string;
  assessmentDate: string;
  gapsEnrollment: boolean;
  gapsEnrollmentDate: string;
  icmEnrollment: boolean;
  icmEnrollmentDate: string;
  reEnrollment: boolean;
  reEnrollmentDate: string;
  fromRemoteUnderservedArea: boolean;
  primaryVulnerability: string;
  secondaryVulnerability: string;
  primaryRiskDomain: string;
  eadStatus: boolean | null;
  eadStatusDate: string; // Add this
  eadReceipt: boolean | null;
  eadReceiptDate: string; // Add this
  schoolEnrollment: boolean | null;
  schoolEnrollmentDate: string; // Add this
  socialSecurityCardReceived: boolean;
  socialSecurityCardReceivedDate: string; // Add this
  socialSecurityApplicationSubmitted: boolean | null;
  socialSecurityApplicationSubmittedDate: string; // Add this
  domesticMedicalScreeningCompleted: boolean | null;
  domesticMedicalScreeningCompletedDate: string; // Add this
  tbiMedicalScreeningCompleted: boolean | null;
  tbiMedicalScreeningCompletedDate: string; // Add this
  healthInsuranceApplicationSubmitted: boolean | null;
  healthInsuranceApplicationSubmittedDate: string; // Add this
  healthInsuranceEnrollment: boolean | null;
  healthInsuranceEnrollmentDate: string; // Add this
  snapApplicationSubmitted: boolean | null;
  snapApplicationSubmittedDate: string; // Add this
  snapApproval: boolean | null;
  snapApprovalDate: string; // Add this
  temporaryHousing: boolean;
  temporaryHousingType: string;
  longTermHousing: boolean;
  minorDependents: string[];
  releaseOfInformation: {
    psychiatric: boolean;
    medical: boolean;
    hivAids: boolean;
    familyHistory: boolean;
    admissionDischarge: boolean;
    chemicalDependency: boolean;
    personalIdentification: boolean;
    employment: boolean;
    financial: boolean;
    educational: boolean;
    progressReports: boolean;
    referralRecommendations: boolean;
    legalHistory: boolean;
    other: boolean;
  };
  serviceProviders: string[];
  clientAgreement: boolean;
}

const EpiscopalPreferredCommunitiesIntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<ClientData>({
    clientName: '',
    alienNumber: '',
    dob: '',
    categoryOfORREligibility: '',
    dateOfEligibility: '',
    gender: '',
    nationality: '',
    ethnicity: '',
    languages: '',
    phoneNumber: '',
    address: '',
    emailAddress: '',
    assessmentDate: '',
    gapsEnrollment: false,
    gapsEnrollmentDate: '',
    icmEnrollment: false,
    icmEnrollmentDate: '',
    reEnrollment: false,
    reEnrollmentDate: '',
    fromRemoteUnderservedArea: false,
    primaryVulnerability: '',
    secondaryVulnerability: '',
    primaryRiskDomain: '',
    eadStatus: false,
    eadStatusDate: '', // Initialize this
    eadReceipt: false,
    eadReceiptDate: '', // Initialize this
    schoolEnrollment: false,
    schoolEnrollmentDate: '', // Initialize this
    socialSecurityCardReceived: false,
    socialSecurityCardReceivedDate: '', // Initialize this
    socialSecurityApplicationSubmitted: false,
    socialSecurityApplicationSubmittedDate: '', // Initialize this
    domesticMedicalScreeningCompleted: false,
    domesticMedicalScreeningCompletedDate: '', // Initialize this
    tbiMedicalScreeningCompleted: false,
    tbiMedicalScreeningCompletedDate: '', // Initialize this
    healthInsuranceApplicationSubmitted: false,
    healthInsuranceApplicationSubmittedDate: '', // Initialize this
    healthInsuranceEnrollment: false,
    healthInsuranceEnrollmentDate: '', // Initialize this
    snapApplicationSubmitted: false,
    snapApplicationSubmittedDate: '', // Initialize this
    snapApproval: false,
    snapApprovalDate: '', // Initialize this
    temporaryHousing: false,
    temporaryHousingType: '',
    longTermHousing: false,
    minorDependents: [],
    releaseOfInformation: {
      psychiatric: false,
      medical: false,
      hivAids: false,
      familyHistory: false,
      admissionDischarge: false,
      chemicalDependency: false,
      personalIdentification: false,
      employment: false,
      financial: false,
      educational: false,
      progressReports: false,
      referralRecommendations: false,
      legalHistory: false,
      other: false,
    },
    serviceProviders: [],
    clientAgreement: false,
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value, type, checked } = e.target as HTMLInputElement;

    if (name.startsWith('releaseOfInformation.')) {
      const field = name.split('.')[1];
      setFormData((prev) => ({
        ...prev,
        releaseOfInformation: {
          ...prev.releaseOfInformation,
          [field]: checked,
        },
      }));
    } else if (type === 'checkbox') {
      setFormData((prev) => ({
        ...prev,
        [name]: checked,
      }));
    } else {
      setFormData((prev) => ({
        ...prev,
        [name]: value,
      }));
    }
  };

  const handleSubmit = (e: FormEvent) => {
    e.preventDefault();
    console.log('Form Data Submitted:', formData);
  };

  return (
    <div className="max-w-4xl mx-auto p-6 bg-white shadow-lg rounded-lg">
      <h1 className="text-3xl font-bold text-center mb-6">
        Episcopal Preferred Communities Program Intake Form
      </h1>

      {/* Add the quote here */}
      <div className="text-center text-gray-700 mb-6">
        <p>
          This form serves as a guide for collecting required information for clients enrolled in PC services (Traditional ICM and GAPS).
          All information collected using this form must be entered into the database "GAPS Intake" tab within 7 days of completion, but
          no later than the 8th of the following month.
        </p>
      </div>




      <form onSubmit={handleSubmit} className="space-y-6">
        {/* Demographic / Contact Information */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Demographic / Contact Information</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div>
              <label className="block text-sm font-medium text-gray-700">Client Name</label>
              <input
                type="text"
                name="clientName"
                value={formData.clientName}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Alien Number</label>
              <input
                type="text"
                name="alienNumber"
                value={formData.alienNumber}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Date of Birth</label>
              <input
                type="date"
                name="dob"
                value={formData.dob}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Category of ORR Eligibility</label>
              <input
                type="text"
                name="categoryOfORREligibility"
                value={formData.categoryOfORREligibility}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Date of Eligibility</label>
              <input
                type="date"
                name="dateOfEligibility"
                value={formData.dateOfEligibility}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Gender</label>
              <input
                type="text"
                name="gender"
                value={formData.gender}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Nationality</label>
              <input
                type="text"
                name="nationality"
                value={formData.nationality}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Ethnicity</label>
              <input
                type="text"
                name="ethnicity"
                value={formData.ethnicity}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Language(s)</label>
              <input
                type="text"
                name="languages"
                value={formData.languages}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Phone Number</label>
              <input
                type="tel"
                name="phoneNumber"
                value={formData.phoneNumber}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Address</label>
              <input
                type="text"
                name="address"
                value={formData.address}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Email Address</label>
              <input
                type="email"
                name="emailAddress"
                value={formData.emailAddress}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700">Assessment Date (The assessment and status date entered into the database should
                both be the date the assessment was conducted with the client) </label>
              <input
                type="date"
                name="assessmentDate"
                value={formData.assessmentDate}
                onChange={handleChange}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                required
              />
            </div>
          </div>
        </div>

{/* Intake Information */}
<div className="space-y-4">
  <h2 className="text-xl font-bold">INTAKE INFORMATION</h2>

  {/* GAPS Enrollment */}
  <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
    <div>
      <label className="block text-sm font-medium text-gray-700">GAPS Enrollment</label>
      <div className="flex items-center mt-2">
        <label className="flex items-center mr-4">
          <input
            type="checkbox"
            name="gapsEnrollment"
            checked={formData.gapsEnrollment}
            onChange={handleChange}
            className="mr-2"
          />
          Yes
        </label>
        <label className="flex items-center">
          <input
            type="checkbox"
            name="gapsEnrollment"
            checked={!formData.gapsEnrollment}
            onChange={(e) => {
              setFormData((prev) => ({
                ...prev,
                gapsEnrollment: !e.target.checked,
              }));
            }}
            className="mr-2"
          />
          No
        </label>
      </div>
      <input
        type="date"
        name="gapsEnrollmentDate"
        value={formData.gapsEnrollmentDate}
        onChange={handleChange}
        className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
      />
    </div>
  </div>

  {/* ICM Enrollment */}
  <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
    <div>
      <label className="block text-sm font-medium text-gray-700">ICM Enrollment</label>
      <div className="flex items-center mt-2">
        <label className="flex items-center mr-4">
          <input
            type="checkbox"
            name="icmEnrollment"
            checked={formData.icmEnrollment}
            onChange={handleChange}
            className="mr-2"
          />
          Yes
        </label>
        <label className="flex items-center">
          <input
            type="checkbox"
            name="icmEnrollment"
            checked={!formData.icmEnrollment}
            onChange={(e) => {
              setFormData((prev) => ({
                ...prev,
                icmEnrollment: !e.target.checked,
              }));
            }}
            className="mr-2"
          />
          No
        </label>
      </div>
      <input
        type="date"
        name="icmEnrollmentDate"
        value={formData.icmEnrollmentDate}
        onChange={handleChange}
        className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
      />
    </div>
    <div>
      <label className="block text-sm font-medium text-gray-700">Re-enrollment</label>
      <div className="flex items-center mt-2">
        <label className="flex items-center mr-4">
          <input
            type="checkbox"
            name="reEnrollment"
            checked={formData.reEnrollment}
            onChange={handleChange}
            className="mr-2"
          />
          Yes
        </label>
        <label className="flex items-center">
          <input
            type="checkbox"
            name="reEnrollment"
            checked={!formData.reEnrollment}
            onChange={(e) => {
              setFormData((prev) => ({
                ...prev,
                reEnrollment: !e.target.checked,
              }));
            }}
            className="mr-2"
          />
          No
        </label>
      </div>
      <input
