                Legal History
              </label>
            </div>
            <div>
              <label className="flex items-center">
                <input
                  type="checkbox"
                  name="releaseOfInformation.other"
                  checked={formData.releaseOfInformation.other}
                  onChange={handleChange}
                  className="mr-2"
                />
                Other
              </label>
            </div>
          </div>
        </div>

        {/* Service Providers */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Service Providers</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div>
              <label className="block text-sm font-medium text-gray-700">Service Providers</label>
              <input
                type="text"
                name="serviceProviders"
                value={formData.serviceProviders.join(', ')}
                onChange={(e) => {
                  setFormData((prev) => ({
                    ...prev,
                    serviceProviders: e.target.value.split(',').map((s) => s.trim()),
                  }));
                }}
                className="mt-1 block w-full p-2 border border-gray-300 rounded-md"
                placeholder="Enter service providers separated by commas"
              />
            </div>
          </div>
        </div>

        {/* Client Agreement */}
        <div className="space-y-4">
          <h2 className="text-xl font-bold">Client Agreement</h2>
          <div className="flex items-center mt-2">
            <label className="flex items-center mr-4">
              <input
                type="checkbox"
                name="clientAgreement"
                checked={formData.clientAgreement}
                onChange={handleChange}
                className="mr-2"
              />
              I agree to the terms and conditions outlined in the client agreement.
            </label>
          </div>
        </div>

        {/* Submit Button */}
        <div className="flex justify-end">
          <button
            type="submit"
            className="bg-indigo-600 text-white px-6 py-2 rounded-md hover:bg-indigo-700 transition-colors"
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default EpiscopalPreferredCommunitiesIntakeForm;
